import React from 'react';
import CarList from './Components/CarList';
import './App.css';

function App() {
  return (
      <div className="App">
        <header>
          <h1>Dealer Auto</h1>
          <p>Cele mai bune oferte de mașini noi și rulate!</p>
        </header>
        <main>
          <CarList />
        </main>
        <footer>
          <p>&copy; 2024 Dealer Auto. Toate drepturile rezervate.</p>
        </footer>
      </div>
  );
}

export default App;
